import './block.scss'
import arrow from '../../images/arrow.svg'

export const Block = ({ title, color }) => {
  return (
    <div className={`block ${color}`}>
      <div className="block__title">{title}</div>
      <div className="block__desc">
        <span>Подробнее</span>
        <img src={arrow} alt="" />
      </div>
    </div>
  )
}
